import React from "react";

const style = {
  parent: {
    display: "flex",
    flex: 1,
    justifyContent: "center",
    alignItems: "center"
  },
  container: {
    width: "30%",
    height: "70vh",
    backgroundColor: "green",
    borderRadius: 10
  }
};

export const TodoContainer = () => {
  return <div style={style.container} />;
};

export default TodoContainer;
